// src/pages/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';
import './H';

const HomePage = () => {
  return (
    <div className="home-page">
      <div className="left-sidebar">
        <Link to="/lessons" className="circle-button">Lessons</Link>
        <Link to="/quiz" className="circle-button">Quiz</Link>
        <Link to="/login" className="circle-button">Login</Link>
        <Link to="/register" className="circle-button">Register</Link>
      </div>
      <div className="main-content">
        <h1>Welcome to ActAware</h1>
        <p>
          Learn sign language with our interactive platform. Explore lessons, take quizzes,
          and join our community.
        </p>
      </div>
    </div>
  );
};

export default HomePage;
